import React from 'react';
import './Home.css'
import Kaibot from '../Kaibot.png'
import { Link } from 'react-router-dom'

function Home() {
  return (
    <div className='home'>
      <img src={Kaibot} className='Img' alt='kaibot'></img>
      <h4 className='Desc'>카이봇은 서버관리, 노래, 검색,<br></br> 인공지능 등 여러가지 기능을<br></br> 보유하고 있는 강력한 디스코드 봇 입니다.</h4>
      <div className='btn-container'>
        <Link to={{
          pathname: 'https://discord.com/oauth2/authorize?client_id=775542914117795860&permissions=8&scope=bot'
        }} target='_blank'>
          <button className='invite'>
            초대하기
          </button>
        </Link>
        <Link to={{
          pathname: '/commands'
        }}>
          <button className='commands'>
            명령어
          </button>
        </Link>
      </div>
    </div>
  );
}

export default Home;
